import React from "react";
import Header from "./components/Header";
import Navbar from "./components/Navbar";
import "./App.css";

function App() {
  return (
    <div className="App">
      <Header />
      <Navbar />
      <main>
        <h2>Welcome to AgriFarm!</h2>
        <p>This is a simple React app using basic CSS.</p>
      </main>
    </div>
  );
}

export default App;
